-- Create tables

--
-- Name: customers; Type: TABLE; Schema: public; Owner: pentaho
--
CREATE TABLE public.customers (
    customernumber INT,
    customername VARCHAR(50),
    contactlastname VARCHAR(50),
    contactfirstname VARCHAR(50),
    phone VARCHAR(50),
    addressline1 VARCHAR(50),
    addressline2 VARCHAR(50),
    city VARCHAR(50),
    state VARCHAR(50),
    postalcode VARCHAR(15),
    country VARCHAR(50),
    salesrepemployeenumber INT,
    creditlimit DOUBLE
);

ALTER TABLE public.customers OWNER TO pentaho;

--
-- Name: month_attributes; Type: TABLE; Schema: public; Owner: pentaho
--
CREATE TABLE month_attributes (
    `Month` DOUBLE,
    quarter DOUBLE,
    mth_full_nm VARCHAR(255),
    mth_short_nm VARCHAR(255)
);

ALTER TABLE public.month_attributes OWNER TO pentaho;

--
-- Name: offices; Type: TABLE; Schema: public; Owner: pentaho
