    city VARCHAR(50),
    phone VARCHAR(50),
    addressline1 VARCHAR(50),
    addressline2 VARCHAR(50),
    state VARCHAR(50),
    country VARCHAR(50),
    postalcode VARCHAR(15),
    territory VARCHAR(10)
);

ALTER TABLE public.offices OWNER TO pentaho;

