    orderlinenumber SMALLINT
);

ALTER TABLE public.orderdetails OWNER TO pentaho;

--
-- Name: orders; Type: TABLE; Schema: public; Owner: pentaho
--
CREATE TABLE public.orders (
    ordernumber INT,
    orderdate DATETIME,
    requireddate DATETIME,
    shippeddate DATETIME,
    status VARCHAR(15),
